import React, {useState, useEffect} from 'react';
import axios from "axios";
const apiKey = "1006fef0a3b86d3192ae766835bf6dc3"


function App() {
  const [city, setCity ] = useState()
let queryUrl = "http://api.openweathermap.org/data/2.5/forecast?"
  useEffect(()=> {
    axios.get(queryUrl,{
      params: {
        APPID: apiKey,
        id: 524901,
        q: "london",
        // maxResults: 2
      }
    }).then(res => setCity(res))
  },[])

  return (
    <div className="App">
      <header className="App-header">
        {city}
      </header>
    </div>
  );
}

export default App;
